range":false},"margin":{"t":30},"hovermode":"closest","title":"t-SNE Projection of Cells by Clustering","hover_mode":"closest","font":{"family":"Overpass"}}},"plot_help":{"data":[["",["(left) Shown here are the total UMI counts for each cell-barcode. Cells with greater UMI counts likely have higher RNA content than cells with fewer UMI counts. The axes correspond to the 2-dimensional embedding produced by the t-SNE algorithm. In this space, pairs of cells that are close to each other have more similar gene expression profiles than cells that are distant from each other. The display is limited to a random subset of cells.","(right) These are the assignments of each cell-barcode to clusters by an automated clustering algorithm. The clustering groups together cells that have similar expression profiles. The axes correspond to the 2-dimensional embedding produced by the t-SNE algorithm. In this space, pairs of cells that are close to each other have more similar gene expression profiles than cells that are distant from each other. The display is limited to a random subset of cells. Please use Loupe Browser to view the entire dataset."]]],"title":"t-SNE Projection"},"table_help":{"helpText":"The differential expression analysis seeks to find, for each cluster, features that are more highly expressed in that cluster relative to the rest of the sample. Here a differential expression test was performed between each cluster and the rest of the sample for each feature. The Log2 fold-change (L2FC) is an estimate of the log2 ratio of expression in a cluster to that in all other cells. A value of 1.0 indicates 2-fold greater expression in the cluster of interest. The p-value is a measure of the statistical significance of the expression difference and is based on a negative binomial test. The p-value reported here has been adjusted for multiple testing via the Benjamini-Hochberg procedure. In this table you can click on a column to sort by that value. Also, in this table features were filtered by (Mean UMI counts \u003e 1.0) and the top N features by L2FC for each cluster were retained. Features with L2FC \u003c 0 or adjusted p-value \u003e= 0.10 were grayed out. The number of top features shown per cluster, N, is set to limit the number of table entries shown to 10,000; N=10,000/K^2 where K is the number of clusters. N can range from 1 to 50. For the full table, please refer to the 'differential_expression.csv' files produced by the pipeline.","title":"Top Features by Cluster (Log2 fold-change, p-value)"},"tables":{"clusterings":[{"key":"gene_expression_graphclust","name":"Graph-based","data":{"columns":[{"Header":"Feature","columns":[{"Header":"ID","accessor":"feature.id"},{"Header":"Name","accessor":"feature.fn"}]},{"Header":"Cluster 1","columns":[{"Header":"L2FC","accessor":"c1.l","greyedout":"c1.g"},{"Header":"p-value","accessor":"c1.p","greyedout":"c1.g"}]},{"Header":"Cluster 2","columns":[{"Header":"L2FC","accessor":"c2.l","greyedout":"c2.g"},{"Header":"p-value","accessor":"c2.p","greyedout":"c2.g"}]},{"Header":"Cluster 3","columns":[{"Header":"L2FC","accessor":"c3.l","greyedout":"c3.g"},{"Header":"p-value","accessor":"c3.p","greyedout":"c3.g"}]},{"Header":"Cluster 4","columns":[{"Header":"L2FC","accessor":"c4.l","greyedout":"c4.g"},{"Header":"p-value","accessor":"c4.p","greyedout":"c4.g"}]},{"Header":"Cluster 5","columns":[{"Header":"L2FC","accessor":"c5.l","greyedout":"c5.g"},{"Header":"p-value","accessor":"c5.p","greyedout":"c5.g"}]},{"Header":"Cluster 6","columns":[{"Header":"L2FC","accessor":"c6.l","greyedout":"c6.g"},{"Header":"p-value","accessor":"c6.p","greyedout":"c6.g"}]}],"data":[{"feature":{"fn":"AC012494.1","id":"ENSG00000227088"},"c1":{"p":1.562e-06,"l":1.182},"c2":{"p":0.1627,"l":-1.449,"g":1},"c3":{"p":0.5327,"l":0.2924,"g":1},"c4":{"p":2.847e-10,"l":-3.763,"g":1},"c5":{"p":4.739e-08,"l":-3.646,"g":1},"c6":{"p":3.287e-06,"l":-3.354,"g":1}},{"feature":{"fn":"CCSER1","id":"ENSG00000184305"},"c1":{"p":4.889e-06,"l":1.11
